import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Step 1: Add an item to the cart to set up the test case
    // We use page.evaluate to call the existing JavaScript function on the page
    await page.evaluate(() => {
      // @ts-ignore
      addToCart(1); // Add product with ID 1 (iPhone)
    });

    // Step 2: Open the cart modal
    await page.waitForSelector('div.cart', { timeout: 5000 });
    await page.locator('div.cart').click();

    // Wait for the cart modal to be visible and take a screenshot
    await page.waitForSelector('#cartModal[style*="display: block"]', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_with_item.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_with_item.png'));

    // Step 3: Find and click the "Remove" button for the item in the cart
    const removeItemButton = page.locator('.cart-item .remove-item');
    await removeItemButton.waitFor({ state: 'visible', timeout: 5000 });
    await removeItemButton.click();

    // Step 4: Verify the item is removed and the cart is empty
    const emptyCartMessage = page.locator('.empty-cart');
    await emptyCartMessage.waitFor({ state: 'visible', timeout: 5000 });

    // Take a final screenshot showing the empty cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_empty.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_empty.png'));

    // Extract data to confirm the task
    const extractedData = {
      emptyCartText: await emptyCartMessage.textContent()
    };

    return {
      success: true,
      action: "Successfully removed an item from the shopping cart.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, return a failure object
    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots, // Return any screenshots taken before the error
      error: error.message
    };
  }
}
